export const settings = {
  radius: "12px",
  shadow: {
    light: "4px 4px 10px 1px #c2cfd6",
    dark: "inset 0 0 10px #000000"
  },
  transition: "0.05s ease-in-out",
  transitionDelay: "1s"
};

export const colors = {
  BLACK: "#000",
  CHAPMAN_RED: "#A50034"
};
